-- ----------------------------
-- Table structure for blog
-- ----------------------------
DROP TABLE IF EXISTS `blog`;
CREATE TABLE `blog`  (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT 'ID编号',
  `title` varchar(80) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '博客标题',
  `summary` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL COMMENT '博客摘要',
  `content` longblob NULL COMMENT '博客内容',
  `date` datetime(0) NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '发布时间',
  `type` int(8) NULL DEFAULT NULL COMMENT '所属专栏',
  `views` int(8) UNSIGNED NULL DEFAULT 665 COMMENT '浏览量',
  `tags` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '标签',
  `comments` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '评论',
  `pictureUrl` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '首图地址',
  `isRecommend` int(1) NULL DEFAULT 0 COMMENT '是否开启推荐',
  `isReprint` int(1) NULL DEFAULT 0 COMMENT '是否开启转载声明',
  `isAppreciation` int(1) NULL DEFAULT 0 COMMENT '是否开启赞赏',
  `isComment` int(1) NULL DEFAULT 0 COMMENT '是否开启评论',
  `property` int(2) NULL DEFAULT NULL COMMENT '1.原创；2.转载；3.翻译',
  `state` int(1) NULL DEFAULT 0 COMMENT '状态：0.草稿；1.已发布',
  PRIMARY KEY (`id`, `title`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 39 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci ROW_FORMAT = Dynamic;

