INSERT INTO `blog` VALUES (37, '【一年总结】记我的大一生活', '去年夏天，平平无奇的我过着平平无奇的生活。 一年之后，依旧是那个夏天，依旧是那个我，只是此时的我成了别人口中的“大佬”。而同是参加软件创新实验室的集训，别人是听课的那个，而我是讲课的那个。我感慨无限，是啊，奋斗真的可以改变人呢！', , '2020-07-25 16:43:23', 12, 563, '10,9,11,13,14', NULL, 'https://img-blog.csdnimg.cn/20200725150352635.jpg?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3FxXzQ2MTAxODY5,size_16,color_FFFFFF,t_70', 1, 1, 1, 1, 1, 1);
INSERT INTO `blog` VALUES (38, '如何去寻找解决bug？（以Mapped Statements collection does not contain value for xxx的异常为例）', '如何去寻找解决bug？我将阐述我自己的理解和找bug的经历，希望对你有所帮助！', , '2020-07-25 16:09:20', 13, 563, '11', NULL, 'https://img-blog.csdnimg.cn/20200725150427127.jpg?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3FxXzQ2MTAxODY5,size_16,color_FFFFFF,t_70', 1, 1, 1, 1, 1, 1);
INSERT INTO `blog` VALUES (39, '【项目实战】 图书信息管理系统（Maven，mybatis）（第一个自己独立完成的项目）', '《程序设计综合训练实践报告》 此项目为图书信息管理系统，是一个采用了mysql+mybatis框架+java编写的maven项目', , '2020-07-25 16:16:51', 15, 563, '15,16,12,11', NULL, 'https://img-blog.csdnimg.cn/20200725150427472.jpg?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3FxXzQ2MTAxODY5,size_16,color_FFFFFF,t_70', 1, 1, 1, 1, 1, 1);
INSERT INTO `blog` VALUES (40, 'IDEA中建包时如何把包分开', '你写mybatis-config.xml配置文件时，采用包扫描时就会报错，因为你会发现尽管mapper.xml和接口文件在同一个包中，但是编译到target文件夹时，这两个文件就会分道扬镳，一个在com.XXX/mapper中，一个在com/XXX/mapper包中。', , '2020-07-25 15:19:19', 14, 563, '17,11', NULL, 'https://img-blog.csdnimg.cn/20200725150428837.jpg?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3FxXzQ2MTAxODY5,size_16,color_FFFFFF,t_70', 1, 1, 1, 1, 1, 1);
INSERT INTO `blog` VALUES (41, '如何理解对象赋值给接口的操作（关键在对象！）', '众所周知，如果一个对象赋值给它的接口，那么这个用接口“接”的对象只有接口所定义的方法和属性，失去了原本对象独有的方法和内容。（当然也规范了代码，不用管底层如何操作实现，不过本文不讨论这些） 按我之前的理解就是——如果把原对象比作一辆拥有众多功能的跑车，那么接口就是大家统一规格的小汽车。如果把这“跑车”赋值给小汽车，那么势必会失去一些独有的功能和属性。 但原来的属性和方法真会消失吗？', , '2020-07-25 15:22:28', 13, 563, '11,14', NULL, 'https://img-blog.csdnimg.cn/20200725150428892.jpg?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3FxXzQ2MTAxODY5,size_16,color_FFFFFF,t_70', 1, 1, 1, 1, 1, 1);
INSERT INTO `blog` VALUES (42, '用Java写数据结构作业——7-2 任务调度的合理性 (25分)', ' 假定一个工程项目由一组子任务构成，子任务之间有的可以并行执行，有的必须在完成了其它一些子任务后才能执行。“任务调度”包括一组子任务、以及每个子任务可以执行所依赖的子任务集。 比如完成一个专业的所有课程学习和毕业设计可以看成一个本科生要完成的一项工程，各门课程可以看成是子任务。有些课程可以同时开设，比如英语和C程序设计，它们没有必须先修哪门的约束；有些课程则不可以同时开设，因为它们有先后的依赖关系，比如C程序设计和数据结构两门课，必须先学习前者。', , '2020-07-25 15:24:38', 16, 563, '11', NULL, 'https://img-blog.csdnimg.cn/20200725150429559.jpg?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3FxXzQ2MTAxODY5,size_16,color_FFFFFF,t_70', 0, 1, 1, 1, 1, 1);
INSERT INTO `blog` VALUES (43, '6-1 最小生成树（普里姆算法） (10分)', '说真的，太久太久没写c语言的程序了，写的极不习惯，c语言的程序调试起来还贼麻烦，几个小错误反复调了好久才找到，着实不容易啊。写个函数题就花了我两小时，唉。。。。。。。', , '2020-07-25 15:27:32', 17, 563, '18', NULL, 'https://img-blog.csdnimg.cn/20200725150429558.jpg?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3FxXzQ2MTAxODY5,size_16,color_FFFFFF,t_70', 0, 1, 1, 1, 1, 1);
INSERT INTO `blog` VALUES (44, 'Java学习日志——springmvc中moudle里的数据渲染不进view里', 'springmvc中moudle里的数据为什么渲染不进view里？ 今天学springMVC时moudle里的数据死也渲染不进view中，然后上网找了各种方法都没用，反倒是把顺便把springMVC的原理给复习了一遍。 问题如下图：  这里我们看到我们代码写的什么，他就传了什么过来，一点渲染都不带！ 唉，当时也和群里的小伙伴讨论了好久，终于找出了问题所在！ 知道问题出在哪吗？ 不在controll...', , '2020-07-25 15:32:12', 14, 563, '19,11', NULL, 'https://img-blog.csdnimg.cn/20200725150429608.jpg?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3FxXzQ2MTAxODY5,size_16,color_FFFFFF,t_70', 0, 1, 1, 1, 1, 1);
INSERT INTO `blog` VALUES (45, '真正的四舍五入', '原文地址：https://blog.csdn.net/qwfylwc/article/details/53939906 下面列举让你惊讶的现象，或许你还一直这么用： 1、使用Math.round()   double d = 1041.735;   d = Math.round(d*100)/100.0; //除以100.0 而不是100   System.out.println(d); //输出...', , '2020-07-25 15:56:18', 18, 563, '11', NULL, 'https://img-blog.csdnimg.cn/20200725150430100.jpg?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3FxXzQ2MTAxODY5,size_16,color_FFFFFF,t_70', 0, 0, 1, 1, 2, 1);
INSERT INTO `blog` VALUES (46, '用Java写数据结构作业——7-2 Dijkstra算法（模板） (30分)', '7-2 Dijkstra算法（模板） (30分) 给一个n(1 ≤ n ≤ 2500) 个点 m(1 ≤ m ≤ 6200) 条边的无向图，求 s 到 t 的最短路。 输入格式: 第一行四个由空格隔开的整数 n、m、s、t。 之后的 m 行，每行三个正整数 s​i​​、t​i​​、w​i​​(1≤w​i​​≤10​9​​)，表示一条从s​i​​ 到 t​i​​ 长度为 w​i​​ 的边。 输出格式...', , '2019-07-25 15:37:36', 16, 563, '11', NULL, 'https://img-blog.csdnimg.cn/20200725150429854.jpg?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3FxXzQ2MTAxODY5,size_16,color_FFFFFF,t_70', 1, 1, 1, 1, 1, 1);
INSERT INTO `blog` VALUES (47, '用Java写数据结构作业——7-1 哈利·波特的考试 (25分)', '7-1 哈利·波特的考试 (25分) 哈利·波特要考试了，他需要你的帮助。这门课学的是用魔咒将一种动物变成另一种动物的本事。例如将猫变成老鼠的魔咒是haha，将老鼠变成鱼的魔咒是hehe等等。反方向变化的魔咒就是简单地将原来的魔咒倒过来念，例如ahah可以将老鼠变成猫。另外，如果想把猫变成鱼，可以通过念一个直接魔咒lalala，也可以将猫变老鼠、老鼠变鱼的魔咒连起来念：hahahehe。 现在哈利...', , '2019-07-25 15:45:22', 16, 563, '11', NULL, 'https://img-blog.csdnimg.cn/20200725150430100.jpg?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3FxXzQ2MTAxODY5,size_16,color_FFFFFF,t_70', 0, 1, 1, 1, 1, 1);
INSERT INTO `blog` VALUES (48, 'Idea访问servlet404问题（java学习日志）', '** java学习日志——Idea访问servlet404问题 ** 最近学了servlet后开始尝试自己部署项目，无论是eclipse还是idea我都试过。但一路上的坎坷只有自己清楚。其中部署项目时最心酸也是困扰我最久的给servlet发送请求时出现404的问题。 可能你把网上的方法试了遍，可依旧没解决你的问题。无论是注解配置（当然也可以是xml配置）还是服务器部署上都没什么问题，但就是出现40...', , '2019-07-25 15:46:50', 14, 563, '11,10', NULL, 'https://img-blog.csdnimg.cn/20200725150430235.jpg?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3FxXzQ2MTAxODY5,size_16,color_FFFFFF,t_70', 0, 1, 1, 1, 1, 1);
INSERT INTO `blog` VALUES (49, '用Java写数据结构作业——7-1 拯救007', '7-1 拯救007 (25分) 在老电影“007之生死关头”（Live and Let Die）中有一个情节，007被毒贩抓到一个鳄鱼池中心的小岛上，他用了一种极为大胆的方法逃脱 —— 直接踩着池子里一系列鳄鱼的大脑袋跳上岸去！（据说当年替身演员被最后一条鳄鱼咬住了脚，幸好穿的是特别加厚的靴子才逃过一劫。） 设鳄鱼池是长宽为100米的方形，中心坐标为 (0, 0)，且东北角坐标为 (50, 50)...', , '2019-07-25 15:48:21', 16, 563, '11', NULL, 'https://img-blog.csdnimg.cn/20200725150431300.jpg?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3FxXzQ2MTAxODY5,size_16,color_FFFFFF,t_70', 0, 1, 1, 1, 1, 1);

